-- Database: usuarios_adea

-- DROP DATABASE IF EXISTS usuarios_adea;

CREATE DATABASE usuarios_adea
    WITH
    OWNER = postgres
    ENCODING = 'UTF8'
    LC_COLLATE = 'Spanish_Spain.1252'
    LC_CTYPE = 'Spanish_Spain.1252'
    LOCALE_PROVIDER = 'libc'
    TABLESPACE = pg_default	
    CONNECTION LIMIT = -1
    IS_TEMPLATE = False;

-- Version de PostgreSQL
SELECT version();

 -- Cambiamos el seteo de fecha para ingresar con el formato dia/mes/año:
 set datestyle to 'European';

-- Crea la tabla
CREATE TABLE USUARIO(
	LOGIN VARCHAR(20) NOT NULL PRIMARY KEY,
    PASS VARCHAR(60) NOT NULL,
    NOMBRE VARCHAR(50) NOT NULL,
    CLIENTE FLOAT NOT NULL,
    
    EMAIL VARCHAR(50),
    FECHAALTA TIMESTAMP NOT NULL DEFAULT CURRENT_TIMESTAMP,
    FECHABAJA TIMESTAMP,
    ESTATUS CHAR(1) NOT NULL DEFAULT 'A',
    
    INTENTOS FLOAT NOT NULL DEFAULT 0,
    FECHAREVOCADO TIMESTAMP,
    FECHA_VIGENCIA TIMESTAMP,
    -- No puede tener un valor vacio o null, por tanto, por defecto puse 0
    NO_ACCESO INT DEFAULT 0,
    
    APELLIDO_PATERNO VARCHAR(50),
    APELLIDO_MATERNO VARCHAR(50),
    AREA NUMERIC(4),
    FECHAMODIFICACION TIMESTAMP NOT NULL DEFAULT CURRENT_TIMESTAMP
);

-- Ver todos los registros
SELECT COUNT(*) FROM USUARIO;

-- Alterar la columna de PASS para que por defecto se setee 0
ALTER TABLE USUARIO ALTER COLUMN PASS TYPE VARCHAR(60);
commit;

SELECT 
  --*	
  column_name, 
  data_type, 
  character_maximum_length, 
  ordinal_position,
  is_nullable, 
  column_default
FROM 
  information_schema.columns 
WHERE 
  table_name = 'usuario'
ORDER BY
	ordinal_position;

